import React from "react";

function PostItem(props) {
  return (
    <div className="posts__container">
      <h3 className="title">{props.title}</h3>
      <h5 className="date">{props.date}</h5>
      <p className="content">{props.content}</p>
    </div>
  );
}

export default PostItem;
